import { motion } from 'framer-motion';
import { 
  Typography, 
  Grid, 
  Card, 
  CardContent, 
  CardMedia, 
  Button,
  Box,
  Container
} from '@mui/material';
import { DirectionsCar, Speed, AttachMoney, Star } from '@mui/icons-material';

function Home() {
  const fadeIn = {
    initial: { opacity: 0, y: 20 },
    animate: { opacity: 1, y: 0 },
    transition: { duration: 0.5 }
  };

  const carImages = [
    'https://source.unsplash.com/random/400x200/?luxury-car',
    'https://source.unsplash.com/random/400x200/?sports-car',
    'https://source.unsplash.com/random/400x200/?modern-car'
  ];

  const features = [
    { icon: <DirectionsCar />, title: "Latest Models", description: "Explore our newest car collection" },
    { icon: <Speed />, title: "Performance", description: "Top-rated performance vehicles" },
    { icon: <AttachMoney />, title: "Best Deals", description: "Competitive prices and offers" },
    { icon: <Star />, title: "Premium Service", description: "Expert customer support" }
  ];

  return (
    <Container>
      <motion.div {...fadeIn}>
        <Box sx={{ textAlign: 'center', my: 8 }}>
          <Typography 
            variant="h2" 
            component="h1" 
            gutterBottom
            sx={{ 
              fontWeight: 'bold',
              background: 'linear-gradient(45deg, #2196F3 30%, #21CBF3 90%)',
              WebkitBackgroundClip: 'text',
              WebkitTextFillColor: 'transparent'
            }}
          >
            Welcome to Car Showroom
          </Typography>
          <Typography variant="h5" color="text.secondary" paragraph>
            Discover your dream car with us
          </Typography>
          <Button 
            variant="contained" 
            size="large" 
            sx={{ mt: 2 }}
            component={motion.button}
            whileHover={{ scale: 1.05 }}
            whileTap={{ scale: 0.95 }}
          >
            Explore Cars
          </Button>
        </Box>

        <Grid container spacing={4} sx={{ mb: 8 }}>
          {features.map((feature, index) => (
            <Grid item xs={12} sm={6} md={3} key={index}>
              <motion.div
                initial={{ opacity: 0, y: 20 }}
                animate={{ opacity: 1, y: 0 }}
                transition={{ delay: index * 0.2 }}
              >
                <Card 
                  sx={{ 
                    height: '100%',
                    display: 'flex',
                    flexDirection: 'column',
                    alignItems: 'center',
                    p: 2,
                    '&:hover': {
                      boxShadow: 6,
                      transform: 'translateY(-5px)',
                      transition: 'all 0.3s'
                    }
                  }}
                >
                  <Box sx={{ 
                    p: 2, 
                    color: 'primary.main',
                    transform: 'scale(1.5)'
                  }}>
                    {feature.icon}
                  </Box>
                  <CardContent>
                    <Typography gutterBottom variant="h6" component="h2" align="center">
                      {feature.title}
                    </Typography>
                    <Typography variant="body2" color="text.secondary" align="center">
                      {feature.description}
                    </Typography>
                  </CardContent>
                </Card>
              </motion.div>
            </Grid>
          ))}
        </Grid>

        <Box sx={{ mb: 8 }}>
          <Typography variant="h4" gutterBottom align="center">
            Featured Cars
          </Typography>
          <Grid container spacing={4}>
            {carImages.map((imageUrl, index) => (
              <Grid item xs={12} md={4} key={index}>
                <motion.div
                  initial={{ opacity: 0, y: 20 }}
                  animate={{ opacity: 1, y: 0 }}
                  transition={{ delay: index * 0.2 }}
                >
                  <Card 
                    sx={{ 
                      '&:hover': {
                        boxShadow: 6,
                        transform: 'translateY(-5px)',
                        transition: 'all 0.3s'
                      }
                    }}
                  >
                    <CardMedia
                      component="img"
                      height="200"
                      image={imageUrl}
                      alt={`Featured Car ${index + 1}`}
                    />
                    <CardContent>
                      <Typography gutterBottom variant="h6">
                        Featured Car {index + 1}
                      </Typography>
                      <Typography variant="body2" color="text.secondary">
                        Experience luxury and performance in this stunning vehicle.
                      </Typography>
                      <Button 
                        variant="outlined" 
                        sx={{ mt: 2 }}
                        component={motion.button}
                        whileHover={{ scale: 1.05 }}
                        whileTap={{ scale: 0.95 }}
                      >
                        Learn More
                      </Button>
                    </CardContent>
                  </Card>
                </motion.div>
              </Grid>
            ))}
          </Grid>
        </Box>
      </motion.div>
    </Container>
  );
}

export default Home;
